import classes from './Cars.module.css';

const Cars = (props) => {

    const cars = props.userCars.map((car, pos) => {
        return <li key={pos}>{car}</li>
    })
    console.log(props.userCars);

  return (
    <div className="cars-list">
      <ul>
        {cars}
      </ul>
    </div>
  );
};

export default Cars;
